import base64
import json

from Cryptodome.Cipher import AES


def decrypt_data(data):
    # 解密
    iv = "amlheW91LHFpYW53".encode("utf-8")
    key = "anN2bXA2NjYsamlh".encode("utf-8")
    cryptor = AES.new(key, AES.MODE_CFB, iv, segment_size=128)
    plain_text = cryptor.decrypt(base64.b64decode(data))
    return plain_text


if __name__ == '__main__':
    data = ""
    result = decrypt_data(data)
    print(json.loads(result.decode('utf-8')))
